DROP TABLE IF EXISTS outsideHubeiTable;
CREATE TABLE outsideHubeiTable(
   ID                  INT  NOT NULL PRIMARY KEY AUTO_INCREMENT
  ,AGE                 VARCHAR(5)
  ,GENDER              VARCHAR(6)
  ,DATE_ONSET_CHAR     VARCHAR(10)
  ,DATE_CONFIRMED_CHAR VARCHAR(10)
  ,OUTCOME             VARCHAR(72)
);

ALTER TABLE outsideHubeiTable
	ADD (DATE_ONSET DATE),
    ADD (DATE_CONFIRMED DATE);

UPDATE outsideHubeiTable
	SET DATE_ONSET = STR_TO_DATE(DATE_ONSET_CHAR, '%d.%m.%Y'),
        DATE_CONFIRMED = STR_TO_DATE(DATE_CONFIRMED_CHAR, '%d.%m.%Y');
        
ALTER TABLE outsideHubeiTable
	DROP COLUMN DATE_ONSET_CHAR,
    DROP COLUMN DATE_CONFIRMED_CHAR;
